                {{ form_row(form.password.first, {'attr': {'class': 'form-control'}}) }}
            </div>
            <div>
               {{ form_row(form.password.second, {'attr': {'class': 'form-control'}}) }}
            </div>
            <div>
                {{ form_label(form.pict) }}
                {{ form_widget(form.pict, {'attr': {'class': 'form-control'}}) }}
            </div>
            <div >
                {{ form_label(form.bio) }}
                {{ form_widget(form.bio, {'attr': {'class': 'form-control'}}) }}
            </div>   

            <br>
            <button style=\"width:100%;\"class=\"btn btn-primary\">{{ button_label|default('Inscription') }}</button>

            {{ form_end(form) }}
    </div>

</div>
